Ready to Download: N5P STA Certification EXP-Off Leakage & MinMax Lib 12_23_2019 

{color:#3C763D}Two Experimental Libraries (N5P) 
 Prepared by Osamu T. 12/23/2019 

 This delivery contains two experimental libraries. 


 1. Off leakage 

 We need to develop the capability of handling the special leakage information for the case where VDD is OFF (LOW) & VPP is ON (HIGH). To achieve this, we tried to add new sections to library.: pg_setting_definition, mode_definition 
 We need your feedback if you think this is the good direction to proceed. OR you have any other ideas, we would like to hear from you. 

 - tcbn05p_bwph210l6p51cnod_base_svt_ffgnp_0p750v_85c_typical_nldm_new_leakage_format.lib


 2. MinMax libraries 
 Here the objective is trying to reduce MIN path optimism. An additional timing group of default timing is added for a multi-bit flop. We want STA to pick up the usual timing group of when condition for MAX path, but pick up this default timing group for MIN path. We will create a small teats case design and send three libraries. Please give us your feedback. 
 Target cell: Cell: MB4SRLSDFQ_NOM2422_D1_H210_L6_P51_UL 
 a. Regular BASE ULVT 
 b. Regular MB ULVT 
 c. Modified MB ULVT 

